// ZggLexerInit initializes any static state used to implement ZggLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewZggLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func ZggLexerInit() {
	staticData := &ZggLexerLexerStaticData
	staticData.once.Do(zgglexerLexerInit)
}

// NewZggLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewZggLexer(input antlr.CharStream) *ZggLexer {
	ZggLexerInit()
	l := new(ZggLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &ZggLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "ZggLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

